import React from 'react';
import './style.css';

const UsuarioSaida = (props) => {
  return (
    <div>
      <div className="caixa">
        <p>Login: {props.username}</p>
        <p>Nome recebido via props</p>
      </div>
      <div className="caixa">
        <p>{props.typedUsername}</p>
        <p>Nome recebido via states e eventos</p>
      </div>
    </div>
  );
};

export default UsuarioSaida;
